import React from 'react'
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import L from 'leaflet';
function Map() {

    const center = [51.505, -0.09]; // Example: London
  const zoom = 13;
  return (
    <div className='mapper'>   <MapContainer center={center} zoom={zoom} style={{ width: '100%', height: '600px' }}>
    {/* TileLayer is the background map */}
    <TileLayer
      url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
      attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
    />
    {/* Marker and Popup */}
    <Marker position={center}>
      <Popup>
        A simple map centered at {center[0]}, {center[1]}.
      </Popup>
    </Marker>
  </MapContainer></div>
  )
}

export default Map
